import React from 'react';
import { Route } from 'react-router-dom';
import SemQuest from './SemQuest';

const Home = () => {
    return (
        <div>
            <h1>Marwari Colleg Important Question</h1>
            <div>
                <a href="/sem-4">Semester 4</a>
                <Route path="/sem-4" value={<SemQuest />}></Route>
            </div>
        </div>
    );
};

export default Home;
